Based on the lexical entries provided, we can construct a SPARQL query to find the total amount of men and women serving in the FDNY:

```sparql
SELECT (SUM(?maleCount) as ?totalMen) (SUM(?femaleCount) as ?totalWomen)
WHERE {
  ?fdny a dbo:Fire_Department .
  ?fdny dbp:employees ?employees .

  {
    SELECT (COUNT(?person) as ?maleCount) WHERE {
      ?person a dbo:Person .
      ?person dbo:occupation ?fdny .
      ?person foaf:gender "male" .
    }
  }

  {
    SELECT (COUNT(?person) as ?femaleCount) WHERE {
      ?person a dbo:Person .
      ?person dbo:occupation ?fdny .
      ?person foaf:gender "female" .
    }
  }
}
```

This query first selects the FDNY organization from DBpedia and retrieves the total count of male and female employees serving in the FDNY by counting the number of male and female persons with the occupation of the FDNY. The results will provide the total number of men and women serving in the FDNY.

